// src/components/Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css'; // Ensure this path is correct

const Home = () => {
  return (
    <div className="home">
      <header className="home-header">
        <h1>Welcome to Micro Credit</h1>
        <p>Your one-stop solution for managing and applying for loans efficiently.</p>
      </header>
      <section id="explore" className="home-explore">
        <h2>A New Way to Manage Your Finances</h2>
        <p>
          Micro Credit is a well-organized tool that helps you get the most out of your financial needs by providing structure to guide your progress.
        </p>
        <Link to="/loan-form" className="explore-button">Get Started</Link>
      </section>
    </div>
  );
};

export default Home;
